```javascript
const myDict = {
  apple: 2,
  banana: 3,
  orange: 1,
  grapes: 4,
  mango: 5,
};

// Using for...in loop to iterate over the keys and push them into an array, then sort them alphabetically using Array.sort()
const sortedKeys = Object.keys(myDict).sort();

for (let i = 0; i < sortedKeys.length; i++) {
  console.log(`${sortedKeys[i]}: ${myDict[sortedKeys[i]}`)
}
```
